package day5.part1

val inputString = ""

fun main() {
    val output = keepRemovingRepeatingCharactersUntilAllGone(inputString)
    println(output)
    println(output.length)

}

fun keepRemovingRepeatingCharactersUntilAllGone(input: String): String {
    val withRepeatingRemoved = removeRepeaingCharacters(input)

    return if (input == withRepeatingRemoved) {
        input
    } else {
        keepRemovingRepeatingCharactersUntilAllGone(withRepeatingRemoved)
    }
}

fun removeRepeaingCharacters(input: String): String {
    val inputArray = input.toCharArray()
    val outputList = inputArray.toMutableList()

    var previousCharacter: Char? = null
    val indexesToRemove = mutableListOf<Int>()

    inputArray.forEachIndexed { index, c ->
        if (previousCharacter == c.swapCase()) {
            indexesToRemove.add(index - 1)
            indexesToRemove.add(index)

            previousCharacter = null
        } else {
            previousCharacter = c
        }
    }

    indexesToRemove.sortedDescending().forEach {
        outputList.removeAt(it)
    }

    return outputList.joinToString("")
}

fun Char.swapCase(): Char {
    return when {
        isUpperCase() -> toLowerCase()
        isLowerCase() -> toUpperCase()
        else -> throw IllegalArgumentException("Only letters allowed")
    }
}